export function login({ username, password }) {
    const formdata = new FormData()
    formdata.append("cqupt_id", username)
    formdata.append("password", password)
    fetch('https://wecqupt.edu.cn/login', {
        method: "POST",
        // headers: {
        //     "Content-Type": "form-data",
        //     "traefik": "user"
        // },
        body: formdata
    }).then((res) => {
        console.log(res)
    })
}
